import { Carousel } from 'antd';
import React from 'react';

class autoCarousel extends React.Component {
    render() {
        return (
            <Carousel autoplay>
                <div>
                    <h3 >1asdfasdf</h3>
                </div>
                <div>
                    <h3 >2</h3>
                </div>
                <div>
                    <h3 >3</h3>
                </div>
                <div>
                    <h3>4</h3>
                </div>
            </Carousel>
        )
    }
}

export default autoCarousel
